import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals'
import store from './redux/store'
import { BrowserRouter } from 'react-router-dom';
// import { addPost, updatePostText, addMessage, updateMessageText, subscribe } from './redux/store'


let rerenderEntireTree = (state) => {

    ReactDOM.render(

        <React.StrictMode>

            <BrowserRouter><App state={staste} addMess={store.addMessage.bind(store)} updateMess={store.updateMessageText.bind(store)} addPost={store.addPost.bind(store)} updatePostText={store.updatePostText.bind(store)} /></BrowserRouter>
        </React.StrictMode>,
        document.getElementById('root')
    );
}

rerenderEntireTree(store.getState());

